insert  into `moderna_anotacoes_objects`(`id`,`object_id`,`userInfo_id`,`anotacao`,`created_at`) values (9,55,18,'Aguardando DA','2014-05-05 10:44:45'),(12,71,18,'Aguardando DA','2014-05-05 10:45:46'),(13,72,18,'Aguardando DA','2014-05-05 10:46:00'),(14,73,18,'Aguardando DA','2014-05-05 10:46:10'),(15,74,18,'Aguardando DA','2014-05-05 10:46:22'),(16,76,18,'Aguardando DA','2014-05-05 10:46:49'),(21,180,18,'Aguardando DA','2014-05-05 10:48:07'),(22,181,18,'Aguardando DA','2014-05-05 10:48:16'),(23,182,18,'Aguardando DA','2014-05-05 10:48:26'),(25,200,18,'Aguardando DA','2014-05-05 10:48:54'),(28,237,18,'Renato gerando v5.','2014-05-05 10:51:40'),(34,504,18,'Ciça (25/04): Daniel iniciou, pediu para passar pro Renato, que está fazendo de casa mas também não pode entregar no prazo devido à dificuldade de produção.\nCiça (29/04): Renato pediu help da arte com arquivo de ai. feito e entregue no mesmo dia. objeto ainda em produção.','2014-05-05 10:53:14'),(35,32,4,'Como temos dois grupos de bichos, o Rodrigo repetiu a mesma retranca para o segundo grupo, usando \"_azul\" no final.\nHouve também uma mudança, por solicitação da Kelly: o quinto animal no tabuleiro será o macaco e não a onça, por isso a retranca precisará ser alterada no roteiro.\n\nEsse objeto é mais complexo e tem uma funcionalidade diferente do tabuleiro tradicional, então pode pedir pro Renato e pro Daniel tirarem as dúvidas comigo ou com a arte, ok?\n','2014-05-05 11:35:34'),(36,531,17,'Aguardando passar pelo programa de legenda do Roberto','2014-05-05 15:05:37'),(39,131,22,'Todos os ajustes foram feitos exceto:\n\n2.	Aumentar o tamanho de todas as cotas do mapa, estão muito pequenas e dificulta a leitura.\n\nEncaminhei um email para o Eduardo com esse solicitação, estou aguardando o retorno dele para concluir o objeto.','2014-05-06 09:30:30'),(40,546,21,'Obs:. este objeto não consta o crédito dos vídeos.','2014-05-06 09:48:37'),(46,474,4,'verificar detalhes:\n\n• em +/- 3:53 tem um pedacinho de texto que aparece durante o fade;\n• em 4:00 a mudança da caixa de texto ficou estranha, seria melhor manter todas alinhadas a esquerda','2014-05-07 12:04:13'),(47,22,17,'Não indiquei no relatório uma solicitação do editor de que se não fosse possível congelar as peças pretas deveria trocar o texto que aparece no box para: “Você deve mexer uma peça branca.”. Acho que é possível congelar as peças. ','2014-05-07 12:48:00'),(50,39,18,'recebemos um e-mail do Felipe com a seguinte informação:\n\nA cartografia esqueceu de incluir a vegetação de várias ilhas. Com o advento do zoom, a ausência ficou evidente.\nDependeremos da velocidade de liberação da cartografia para entregá-lo.\nEstou enviando a pauta de alteração para arte.\nAssim que estiver tudo óquei, libero o relatório com o mapa editado.\n','2014-05-09 08:56:48'),(52,481,9,'Aguardando confirmação do Diego para o texto do botão \"Meiose/Fecundação\" na seção \"Fungos\".','2014-05-09 10:37:24'),(54,481,18,'O texto novo de Meiose/Fecundação está correto e foi validado pelo Diego.','2014-05-09 12:08:29'),(56,544,30,'favor considerar este caminho:\nG:\\Depto\\01_PRODUCAO\\02_arariba\\03_reaproveitados\\sociologia\\Soc7_un01an_cultura\\provas\\02','2014-05-09 17:29:44'),(59,531,21,'Re, dei uma olhada no vídeo depois de pronto, e vi palavrões na legenda, não sei se vai ficar assim ou mudar.','2014-05-14 09:13:56'),(64,47,9,'Aguardando arquivos abertos da produtora. A Ciça já solicitou.','2014-05-15 19:52:02'),(65,505,9,'Preciso que a arte faça essas correções nas imagens.','2014-05-19 18:16:52'),(66,471,9,'Aguardando ajuda da arte com os retoques das imagens solicitados.','2014-05-20 10:30:29'),(67,520,4,'Verificar com a produtora a possibilidade de recebermos os vídeos brutos das duas câmeras.','2014-05-20 16:43:14'),(68,516,8,'Interface em:\nTecnologia_Moderna/Depto/01_PRODUCAO/02_arariba/02_novos/portugues/ARpor7_un01jg_heroi/imagens/altas/interface/v1','2014-05-20 16:46:32'),(69,471,9,'A arte foi fazer as correções e questionaram itens com o Felipe, que está averiguando possíveis alterações.','2014-05-20 17:59:47');

